#define DR  23 // -> DR   // Data-Receive
#define OE  21 // -> OE   // Output-Enable
#define CLK 18 // -> CLK  // Data-Clock
#define LAT  5 // -> LAT  // Data-Latch
#define RSA 32 // -> A    // Row Select A
